import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";

import styles from './NavBar.module.css';

const NavBar = (props) => {


    return(
            <ul className={`${styles.sidenav}`}>
                <Link to="/" style={{ textDecoration: 'none' }}>
                    <li className={`${styles.li} menu-item`} id="manage-products">
                    Manage Products
                    </li>
                </Link>
                <Link to="/manage-inventory" style={{ textDecoration: 'none' }}>
                    <li className={`${styles.li} menu-item`}  id="manage-inventory">
                    Manage Inventory
                    </li>
                </Link>
                <Link to="/manage-payments" style={{ textDecoration: 'none' }}>
                    <li className={`${styles.li} menu-item`} id="manage-payments">
                    Manage Payments
                    </li>
                </Link>
                <Link to="/manage-accounts" style={{ textDecoration: 'none' }}> 
                    <li className={`${styles.li} menu-item`} id="manage-accounts">
                    Manage Accounts
                        </li>
                </Link>
            </ul>
    );
}

export default NavBar;
